import { Container } from "@mui/system";
import "../App.css";
import Project from "../components/Project";

import React from "react";

// MUI Grid
import Grid from "@mui/material/Grid";
import Item from "@mui/material/Grid";

function Projects() {
  let projects = [
    {
      Name: "Peak Performance App (QUT CAPSTONE Project)",
      Topics: "React Native • AWS • Node",
      Desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus lacinia nec augue ac aliquam.",
      Link: "",
    },
    {
      Name: "Sorting algorithms, which one would win in a race?",
      Topics: "React Native • AWS • Node",
      Desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus lacinia nec augue ac aliquam.",
      Link: "",
    },
    {
      Name: "What's a backend framework and where can I find one?",
      Topics: "React Native • AWS • Node",
      Desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus lacinia nec augue ac aliquam.",
      Link: "",
    },
  ];

  let componentsArr = [];
  for (let i = 0; i < projects.length; i++) {
    componentsArr.push(
      <Grid xs={6} sx={{ p: 2 }}>
        <Project
          title={projects[i].Name}
          topics={projects[i].Topics}
          desc={projects[i].Desc}
          link={projects[i].Link}
        />
      </Grid>
    );
  }

  return (
    <div
      style={{
        width: "100%",
        height: "100%",
        position: "absolute",
        backgroundColor: "#121212",
      }}
    >
      <Container
        className="aboutMe"
        style={{ color: "white", textAlign: "justify", paddingTop: "8vh" }}
      >
        <h1>Projects</h1>
        {/* <Grid container spacing={4}> */}
        {componentsArr}
        {/* </Grid> */}
      </Container>
    </div>
  );
}

export default Projects;
